    <div class="irr-content">
        <div class="irr-content"><p>Mortgage rates mostly rose this week, according to Bankrate's latest survey of interest rates.</p><p>The benchmark 30-year fixed-rate mortgage rose 5 basis points to 3.87%. The benchmark 15-year fixed-rate mortgage kept its place at 3.1% for the 2nd consecutive week.</p><p>The typical 30-year fixed-rate jumbo mortgage rose 4 basis points to 3.78%. For purposes of Bankrate's survey, a jumbo mortgage is a loan that is at least $650,000.</p><p>A basis point is one-hundredth of 1%.</p><p>The average 5/1 adjustable-rate mortgage ticked up 1 basis point to 3.33%. With a 5/1 ARM, the rate is fixed for 5 years and adjusted annually thereafter.</p><p>Mortgage applications rose by 0.2% last week compared with the previous week, according to the Mortgage Bankers Association's weekly survey.</p></div>        </div>
